function addMultipleElements() {
  var elementCount = 5;
  for (var i = 0; i < elementCount; i++) {
    addElement();
  }
}

function addElement() {
  var elements = document.getElementById("elements");
  var element = newSelfRemovableElement();
  elements.appendChild(element);
}

function newSelfRemovableElement() {
  var li = document.createElement("li");
  li.innerText = "tap to remove";
  li.onclick = li.remove;
  return li;
}

function emptyElements() {
  var elements = document.getElementById("elements");
  elements.innerHTML = "";
}

var spinnerDegree = 0;
var spinner = document.getElementById("spinner");
spinner.addEventListener("click", function () {
  spinnerDegree += 360;
  this.style.transform = "rotate(" + spinnerDegree + "deg)";
});

function toggleBackground() {
  spinner.classList.toggle("active");
}

function displayResultTestWebView(text) {
  var elements = document.getElementById("testWebView");
  elements.innerText = text;
}

function detectWindowAndroid() {
  var android = window.Android;
  if (android === undefined) {
    displayResultTestWebView("window.Android is undefined");
  } else {
    displayResultTestWebView(JSON.stringify(android));
  }
}

function detectUserAgent() {
  var userAgent = window.navigator.userAgent.toLowerCase();
  var safari = /safari/.test(userAgent);
  var ios = /iphone|ipod|ipad/.test(userAgent);

  displayResultTestWebView(
    `userAgent : ${userAgent} safari : ${safari} && ios : ${ios}`
  );
}

function detectWindowTop() {
  displayResultTestWebView(window.self == window.top);
}

