// functions to create a GUID
function sdbmCode(str) {
  let hash = 0;
  for (let i = 0; i < str.length; i += 1) {
    hash = str.charCodeAt(i) + (hash << 6) + (hash << 16) - hash;
  }
  return Math.abs(hash);
}

function generateGuid() {
  // These properties have all been marked as supported by
  // existing navigators.
  // see http://www.w3schools.com/jsref/prop_nav_useragent.asp
  const userData =
    navigator.userAgent + navigator.language + navigator.platform;
  const h = sdbmCode(userData).toString(16).slice(-4);
  let d = new Date().getTime();
  const uuid = "xxxxxxxx-hhhh-axxx-yxxx-xxxxxxxxxxxx".replace(/[xy]/g, (c) => {
    const r = (d + Math.random() * 16) % 16 | 0;
    d = Math.floor(d / 16);
    return (c === "x" ? r : (r & 0x7) | 0x8).toString(16);
  });
  return uuid.replace("hhhh", h);
}

